Miss America 2024 👑✨🎀
.
.
What an honor to host over 300 guests at the 1st annual @missamericaslittlesisters Tea Party! Being a part of the @missamerica mentor program since the age of 5, serving as Miss SC’s Teen + staying involved as the mentor program coordinator is a dream come true! 

A HUGE thank you to the most incredible friend + other half #MarisaDorchock for coordinating everything with me. There is nothing we can’t accomplish together and no one else I’d rather experience these adventures with. Thank you for everything you did to help make this happen for these little girls. 

Momma, thank you for ALL you do every single day. Making sure the @crowncouturecollection booth was perfect, prepping with me for the Tea Party + everything in between. I love you! 

@robinflemingceo, thank you for choosing us to be a part of your incredible team. You are a trailblazer + I can’t wait to see what the future holds for @missamericaslittlesisters and continue to grow the program for the future of Miss America! 

Lastly, to our wonderful friends + sponsors! We are so thankful to everyone who helped make this event happen! 

